import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View } from "react-native";
import Ionicons from 'react-native-vector-icons/Ionicons';


import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import HomeScreen from "./HomeScreenWinterScreen";
import SummerScreen from "./SummerScreen";
// import WinterScreen from "./components/WinterScreen";
// import FallScreen from "./components/FallScreen";
// import SpringScreen from "./components/SpringScreen";
import { auth } from "../firebase";
import LandingScreen from "./LandingScreen";

const Tab = createBottomTabNavigator();

export default function BottomTabNav() {
  return (
      <Tab.Navigator>
        <Tab.Screen name='Home' component={HomeScreen} />
        <Tab.Screen name='Settings' component={LandingScreen} />
      </Tab.Navigator>

  );
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#E5E5E5",
    alignItems: "center",
    justifyContent: "center",
  },
});
